import {React, useEffect, useState} from 'react'

function Insert() {

  const [name, setName] = useState('');
  const [price, setPrice] = useState('');
  const [data, setData] = useState(null)

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    try {
      const response = await fetch("http://localhost:5000", {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ name, price }),
      });
      
      if (!response.ok) {
        throw new Error("Failed to submit data");
      }

      const dt = await response.json();
      console.log(dt);
      setData(dt.message);
    } catch (error) {
      console.error("Error:", error);
    }
  };

  return (
    <div className='input-items'>
        <form onSubmit={handleSubmit} method='post'>
            <label htmlFor='item-name'>Item Name</label>
            <input type="text" id="item-name" name='name' value={name} placeholder='Enter Item name' onChange={(e) => setName(e.target.value)} />
            <br />

            <label htmlFor='item-price'>Item Price</label>
            <input type="text" id="item-price" name='price' value={price} placeholder='Enter Item Price'onChange={(e) => setPrice(e.target.value)} />
            <br />

            <label htmlFor='item-image'>Upload Image</label>
            <input type="file" id="item-image" name='item-image'/>
            <br />

            <button type="submit">Make</button>
        </form>
        <h2>Message</h2>
        <p>{data}</p>
    </div>
  )
}

export default Insert
